import './App.css';

import {BrowserRouter as Router  , Route , Switch } from 'react-router-dom';

import Register from './registration/register';
import Login from './login/login';



function App() {
  return (
    <Router>
     <Switch>
       <Route path='/' >
         <Login/>
       </Route>
       <Route path='/reg' >
         <Login/>
       </Route>
     </Switch>
    </Router>
  );
}

export default App;
